import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

// Depending on the current path, this component sets the "active" class on the appropriate navigation link item
function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div>
        <ul className="navbar-nav">

            <Link
              to="/"
              className={
                window.location.pathname === "/" || window.location.pathname === "/Feed"
                  ? "nav-link active"
                  : "nav-link"
              }
            >
              MESSIER
            </Link> 

            <Link
              to="/journal"
              className={window.location.pathname === "/journal" ? "nav-link active" : "nav-link"}
            >
              JOURNAL
            </Link>


            <Link
              to="/mood"
              className={window.location.pathname === "/mood" ? "nav-link active" : "nav-link"}
            >
              Mood
            </Link>


            <Link
              to="/account"
              className={window.location.pathname === "/account" ? "nav-link active" : "nav-link"}
            >
              Account
            </Link>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
